import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      {States()}
      {Grid()}
    </div>
  );
}

function States() {
  return (
    <div>
      <p>California</p>
      <p>Texas</p>
    </div>
  );
}

function Grid() {
  return (
    <div>
      <p>1</p>
      <p>2</p>
    </div>
  );
}

export default App;
